import React, { Component } from "react";

class Layout extends Component {
  state = {};
  render() {
    return (
      <div class="flex flex-column">
        <div class="outline w-100 pa3 mr2">
          <code>1</code>
        </div>
        <div class="outline w-100 pa3 mr2 h6">
          <code>2</code>
        </div>
        <div class="outline w-100 pa3 mr2">
          <code>3</code>
        </div>
      </div>
    );
  }
}

export default Layout;
